import Title from '../../components/Title/Title'
import Text from '../../components/Text/Text'

const Cashback = ({className, data, onModalButtonActiveClick}) => {
  const {
    title, 
    texts, 
    orderBtn
  } = data
  
  return (
    <section 
      data-name={className} 
      className={className ? className : 'cashback'}
    >      
      <div className={`${className}__wrapper`}>
        <div className={`${className}__body`}>
          {title && (
            <Title 
              className={className} 
              title={title}                  
            />
          )}
          {texts.length && (
            texts.map(text => 
              <Text 
                className={className} 
                text={text} 
                key={text}/>
            )
          )}
          <button 
            data-btn={orderBtn.target} 
            className={`${className}__btn`}
            onClick={onModalButtonActiveClick}
          >
            {orderBtn.data}
          </button>
        </div>
      </div>
    </section>
  )
}
export default Cashback
